              var indent = $(this).filter('p').prev().children('chunk_end').position().left;
              $(this).filter('p').css('text-indent', indent + 'px') 
            }
          });
        }
      }
      $('.lazy_load_external').lazyload({threshold: 5500, load: load_external});
    </script>
